      "full_text" : "3) Fine lines over deadlines\n\nI have been enjoying the slow eating in Europe (they don't kick us out). Turns out that I also love editing. While deadlines help me stay productive, this now needs no hustle.\n\nI will prefer more time to fall in love with my words.",
      "lang" : "en",
      "in_reply_to_screen_name" : "ZekeAranyLucas",
