      "full_text" : "@ahz101_ Thanks! \n\nOf course, individual teams may have other constraints to organize on. \n\nThese came from helping CTO friend. The context there made these options salient to me.",
      "lang" : "en",
      "in_reply_to_screen_name" : "ahz101_",
