      "truncated" : false,
      "retweet_count" : "0",
      "id" : "1561085875810869248",
      "created_at" : "Sat Aug 20 20:20:51 +0000 2022",
      "favorited" : false,
      "full_text" : "Engineering leaders:\nDon‚Äôt automatically split the dev team on code boundaries if you want &gt;2x impact from 2x headcount üö¢\n\nWhen teams and products are small and slow growing, it's better for everyone to know all the code.\n\nBut what happens in rapid growth?",
      "lang" : "en"
