      "full_text" : "So my goal over the next year is to record and publish 24 more interviews to inspire and promote the idea that the best teams are built with diversity.\n\nAlong the way, I will improve as a listener, speaker, and writer (and maybe even learn some marketing skills).\n\nü¶Ñ",
