      "full_text" : "Then the wild growth of bootcamps and online resources for self-teaching software development caught my eye.\n\nI had to know more stories from this generation of SDEs!\n\nI predict a future tech industry, full of diversity, changed by side-loading unconventional talent.\n\nüè≥Ô∏è‚Äçüåà",
