      "full_text" : "Reading @add_hawk led me to a deeper exploration of how gamification pervades my options and becomes more exploitive like a constant casino.\n\nIn 6 months, I have:\n\n‚Ä¢ quit F2P and IAP games\n‚Ä¢ uninstalled social media from my phone\n‚Ä¢ built a fitness habit with no points",
