      "favorited" : false,
      "full_text" : "Managers can mitigate risk by being transparent and setting expectations. And welcoming accountability. \n\nThis is a core skill, so by getting good at it you will be rewarded by both your bosses and reports.\n\nPrioritizing means investing time early.",
      "lang" : "en",
