      "full_text" : "üö® It‚Äôs up to all of us to help improve Diversity, Equity, and Inclusion in Tech üö®\n\n‚û°Ô∏è‚û°Ô∏è Sign up as a coach and level up your skills as a leader.\n\n‚û°Ô∏è‚û°Ô∏è Signup as a student and give yourself another foot in the door.\n\nhttps://t.co/NNVs4NePNn",
