      "full_text" : "üëâÔ∏è WAGMI \n\nBoth projects I helped with were for web3. When coaching, I separate my skepticism of any new tech and focus on my optimism in the students to realize their potential. Plus I learn something new.\n\nWeb3 ventures look good for a start to lifelong learning journeys.",
