      "favorited" : false,
      "full_text" : "üëâÔ∏è Students have many paths\n\nIn my first workshop, I met two women in Berlin who had both been through bootcamps and looking to make the jump. \n\nLuckily, university and certifications are optional and non-traditional paths are celebrated.",
      "lang" : "en",
      "in_reply_to_screen_name" : "ZekeAranyLucas",
      "in_reply_to_user_id_str" : "1397633867486580741"
