      "full_text" : "üëâÔ∏è Anyone can be a coach\n\n@codebar runs periodic workshops where students and coaches are paired up over discord. Coaches are matched by skills needed for students in the workshop. \n\nTeaching others is one of the best ways to validate and level up your own skills.",
