      "full_text" : "üëâÔ∏è Big orgs are slow to change\n\nI was on the diversity council at the Amazon Berlin office for 3 years. I learned how hard it is to change institutions at this scale, even when there is explicit energy allocated for DEI.\n\nWe can do better.",
      "lang" : "en",
