      "created_at" : "Wed Mar 23 09:41:53 +0000 2022",
      "favorited" : false,
      "full_text" : "üëâÔ∏è Opportunity is real in Berlin and EMEA\n\nI was hiring for Amazon Berlin dev hub while we grew from ~25 people to more than 1500 since 2014. Talent was already so tight in US, that projects and teams moved to Berlin to fill headcount. \n\n@GergelyOrosz has more growth insights",
