      "created_at" : "Sun Nov 21 13:10:34 +0000 2021",
      "favorited" : false,
      "full_text" : "Of course, with agile changes, OP1 doc is almost instantaneously an anachronism, but it still serves as an anchor and the quickest way to ramp up on what a team is up to, even a year later. \"hey, new team, can I see your OP1?\"",
